    (CIA) with health care providers and other entities as part of the settlement of
    Federal health care program investigations arising under a variety of civil false
    claims statutes. Providers or entities agree to the obligations, and in exchange,
    OIG agrees not to seek their exclusion from participation in Medicare, Medicaid,
